// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/effect-fade";
import "swiper/css/navigation";
import "swiper/css/pagination";
import Aws from "../Images/aws.jpg";
import Testing from "../Images/software-testing-image.jpg";
import Development from "../Images/web-dev.jpg";

// import required modules
import { EffectFade, Autoplay, Navigation, Pagination } from "swiper";

export default function LandingPage() {
  return (
    <>
      <Swiper
        spaceBetween={30}
        effect={"fade"}
        navigation={true}
        autoplay={{
          delay: 2000,
          disableOnInteraction: false,
        }}
        pagination={{
          clickable: true,
        }}
        modules={[EffectFade, Navigation, Pagination, Autoplay]}
        className="mySwiper"
      >
        <SwiperSlide className="slide1"></SwiperSlide>
        <SwiperSlide className="slide2"></SwiperSlide>
        <SwiperSlide className="slide3"></SwiperSlide>
      </Swiper>
    </>
  );
}
